        factory = msg.sender;
        token0 = _token0;
        token1 = _token1;
        token0Name = _token0Name;
        token1Name = _token1Name;
        TWAMM.initialize(orderPools, _token0, _token1, _twammIntervalSize);
    }

    function getAmounts()
        external
        view
        returns (uint112 amount0, uint112 amount1)
    {
        amount0 = x;
        amount1 = y;
    }

    function getLongTermOrderInterval()
        external
